  DELETE

    FROM notas

  WHERE cod_registro_detalle = cod_registro_detalle_in;

  -- ELIMINA ASISTENCIA DEL ALUMNO

  DELETE

    FROM asistencia

  WHERE cod_registro_detalle = cod_registro_detalle_in;

  -- ELIMINA AL ALUMNO DEL REGISTRO DETALLE

  DELETE

    FROM registro_detalle

  WHERE cod_registro_detalle = cod_registro_detalle_in;



END ;;
