CREATE DEFINER=`root`@`localhost` PROCEDURE `registro_entregado`(IN `cod_registro_in` BIGINT(20), IN `cod_profesorist_in` CHAR(10) CHARSET utf8)
BEGIN
if (select entregado from registro where cod_registro=cod_registro_in and cod_profesorist=cod_profesorist_in)='si' then
  UPDATE registro
  SET entregado = 'no'
  WHERE cod_registro = cod_registro_in and cod_profesorist=cod_profesorist_in;
  else
   UPDATE registro
  SET entregado = 'si'
  WHERE cod_registro = cod_registro_in and cod_profesorist=cod_profesorist_in;
  end if;
END ;;
